		Level \; h=1 & \qquad & I \left [1, \; p_k^2 \right ]_{h=1} & \cup & I \left [p_k^2+1, \; m_k \right ]_{h=1} & = & I \left [1, \; m_k \right ]_{h=1}\\
	};
